import React from "react"
import "./Modal.scss"

interface TypeModalProps {
    visibleModal: boolean,
    setVisibleModal: (visibleModal: boolean) => void,
    visibleWinner: boolean,
    setWisibleWinner: (visibleWinner: boolean) => void,
    winner: string
}


const Modal: React.FC <TypeModalProps> = ({visibleModal, setVisibleModal, visibleWinner, winner}) => {



    return(
        <div className="container_modal">
            {visibleWinner
            ? <h1>{winner}</h1>
            : <div>
                <h1>New Game</h1>
                <div className="btn_modal" onClick={() => setVisibleModal(!visibleModal)}><h1>GO!</h1></div>
              </div>
            }
            
        </div>
    )
}

export default Modal;
